import React, { useState } from 'react'

function Test() {

  const [Content, setContent] = useState("");

  const onSubmit = () => {
    alert();
  };
  return (
    <div>
      <input type="text" 
      value={Content} 
      onChange={(e)=> {
        setContent(e.currentTarget)
      }}
      />
      <button onClick={() => {
        onSubmit();
      }}>Submit</button>
    </div>
  );
}

export default Test
